import React, { useState, Component } from "react";
import "./App.css";
import Routes from "./Routes";
import axios from "axios";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = { test: [] };
  }
  componentDidMount() {
    axios
      .get("http://127.0.0.1:8000/api/restaurant")
      .then((response) => this.setState({ test: response.data.name }));
  }
  renderTest() {
    const { test } = this.state;
    return test.map((test) => <div key={test.id}>{test.name}</div>);
  }

  render() {
    return (
      <div>
        <Routes />
        <div>{this.renderTest()}</div>
      </div>
    );
  }
}

export default App;
